import styled from 'styled-components';
import { Label } from '@buffetjs/core';

const EnumerationWrapper = styled(Label)`
  width: 415px;
  margin-bottom: 3px;
  min-height: 91px;
  position: relative;
  padding-left: 54px;
  padding-top: 17px;
  cursor: pointer;
`;

export default EnumerationWrapper;
